import React from 'react';
import '../chat/chat.scss';
import logo from './mupy_logo.svg';

let ChatHeader = props => {
    return (
      <div className="chat-header">
        <div>
            <img className="chat-header__logo" src={logo} alt="app logo" />
        </div>
      </div>
    );
  };

export default ChatHeader;
